interface ButtonComponenteProps {
  titulo: string;
  onClick: () => void;
}

const ButtonComponente: React.FC<ButtonComponenteProps> = (props) => {
  return (
    <B.Button onClick={props.onClick}>
      {props.titulo}
    </B.Button>
  );
}

export default ButtonComponente;
